import React from "react";
import { useNavigate } from "react-router-dom";
import './BlogCarrossel.css';
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

function PrevArrow(props) {
    const { className, style, onClick } = props;
    return (
        <div
            className={`${className} custom-prev-arrow`}
            style={{ ...style, display: "block" }}
            onClick={onClick}
        />
    );
}

function NextArrow(props) {
    const { className, style, onClick } = props;
    return (
        <div
            className={`${className} custom-next-arrow`}
            style={{ ...style, display: "block" }}
            onClick={onClick}
        />
    );
}

function BlogCarrossel() {
    const navigate = useNavigate();

    const handleCardClick = (id) => {
        navigate(`/materia/${id}`);
    };

    const settings = {
        dots: true,
        infinite: true,
        slidesToShow: 3.65,
        slidesToScroll: 1,
        nextArrow: <NextArrow />,
        prevArrow: <PrevArrow />,
        responsive: [
            {
                breakpoint: 1024,
                settings: {
                    slidesToShow: 2,
                    slidesToScroll: 1,
                },
            },
            {
                breakpoint: 768,
                settings: {
                    slidesToShow: 1,
                    slidesToScroll: 1,
                },
            },
        ],
    };

    return(
    <>
        <h1 className="BlogTitle">Blog</h1>

        <div className="slider-blog">
            <Slider {...settings} className="custom-slider-blog">
                <div className="custom-card-blog">
                    <div className="card-image-blog" id="blog-1"></div>
                    <div className="card-content-blog">
                        <h2>O que é um colchão certificado e por que é importante pensar nisso na hora de dormir?</h2>
                        <p>Você já se perguntou o que significa um colchão ser certificado? E por que isso é tão importante na hora de escolher o seu? 
                        Aposto que você deve concordar que ter um sono reparador é fundamental para manter a qualidade de vida e o bem-estar no dia a dia. E, para dormir bem, um bom colchão é essencial. </p>
                        <a href="../pages/Materia">
                            <img src="https://bfbaby.com.br/up/leia_mais.png" alt="Leia mais" className="red-more" />
                        </a>
                    </div>
                </div>
                <div className="custom-card-blog">
                    <div className="card-image-blog" ></div>
                    <div className="card-content-blog">
                        <h2>O que é um colchão certificado e por que é importante pensar nisso na hora de dormir?</h2>
                        <p>O que é um colchão certificado e por que é importante pensar nisso na hora de dormir?</p>
                    </div>
                </div>
                <div className="custom-card-blog">
                    <div className="card-image-blog" ></div>
                    <div className="card-content-blog">
                        <h2>O que é um colchão certificado e por que é importante pensar nisso na hora de dormir?</h2>
                        <p>O que é um colchão certificado e por que é importante pensar nisso na hora de dormir?</p>
                    </div>
                </div>
                <div className="custom-card-blog">
                    <div className="card-image-blog" ></div>
                    <div className="card-content-blog">
                        <h2>O que é um colchão certificado e por que é importante pensar nisso na hora de dormir?</h2>
                        <p>O que é um colchão certificado e por que é importante pensar nisso na hora de dormir?</p>
                    </div>
                </div>
                <div className="custom-card-blog">
                    <div className="card-image-blog" ></div>
                    <div className="card-content-blog">
                        <h2>O que é um colchão certificado e por que é importante pensar nisso na hora de dormir?</h2>
                        <p>O que é um colchão certificado e por que é importante pensar nisso na hora de dormir?</p>
                    </div>
                </div>
            </Slider>
        </div>
    </>
    );
};

